import React from "react";

const PostItem = () => {
  return (
    <div className="item">
      <div className="image">
        <img src="" alt="img" />
      </div>
      <div className="content">
        <div className="header">TITLE</div>
        <div className="description">POST TEXT</div>
      </div>
      <div className="extra">
        <span class="left floated like">
          <i class="like icon"></i>
          Like
        </span>
        <span class="right floated star">
          <i class="star icon"></i>
          Comment
        </span>
      </div>
    </div>
  );
};

export default PostItem;
